import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import '../css/Git.css'; // Import your Git CSS file here

function Git() {

    const navigate = useNavigate();
    const [showBackButton, setShowBackButton] = useState(false);
    let lastScrollY = window.scrollY;

    useEffect(() => {
        const handleScroll = () => {
            if (window.scrollY < lastScrollY) {
                setShowBackButton(true); // Show button when scrolling up
            } else {
                setShowBackButton(false); // Hide button when scrolling down
            }
            lastScrollY = window.scrollY;
        };

        window.addEventListener('scroll', handleScroll, { passive: true });

        return () => {
            window.removeEventListener('scroll', handleScroll);
        };
    }, []);

    const handleBack = () => {
        navigate(-1); // Go back to the previous page
    };

    return (
        <div className="git-page">
            <button className="back-button" onClick={handleBack}>Back</button>

            {/* Introduction */}
            <section className="git-intro">
                <h1>Git Tutorial</h1>
                <p>Welcome to the Git tutorial. Discover the essentials of Git version control to enhance your coding workflow.</p>
            </section>

            {/* Git vs GitLab */}
            <section className="git-vs-gitlab">
                <h2>Difference Between Git and GitLab</h2>
                {/* Content explaining the difference */}
            </section>

            {/* Git Basics */}
            <section className="git-basics">
                <h2>Git Basics</h2>
                {/* Basic Git commands and explanations */}
            </section>

            {/* Common Git Commands */}
            <section className="git-commands">
                <h2>Common Git Commands</h2>
                {/* Examples of common commands like git add, git commit, etc. */}
            </section>

            {/* Branching and Merging */}
            <section className="git-branching">
                <h2>Branching and Merging</h2>
                {/* Explanation and examples of branching and merging */}
            </section>

            {/* Working with Remotes */}
            <section className="git-remotes">
                <h2>Working with Remotes</h2>
                {/* How to work with remote repositories, git push, git pull, etc. */}
            </section>

            {/* Resolving Merge Conflicts */}
            <section className="git-merge-conflicts">
                <h2>Resolving Merge Conflicts</h2>
                {/* Guide on how to resolve conflicts that occur during merging */}
            </section>

            {/* Using Git in a Team */}
            <section className="git-team">
                <h2>Using Git in a Team</h2>
                {/* Best practices for using Git in a collaborative environment */}
            </section>

            {/* Advanced Git Techniques */}
            <section className="git-advanced">
                <h2>Advanced Git Techniques</h2>
                {/* Cover advanced topics like rebase, cherry-pick, etc. */}
            </section>

            {/* Possible Errors and Solutions */}
            <section className="git-problems">
                <h2>Possible Errors and Solutions</h2>
                <p>Encountering issues in Git is common. Here's how to troubleshoot some frequent problems:</p>
                <ul>
                    <li><strong>Permission Denied:</strong> This often occurs when you don't have permission to push to a repository. Check your repository permissions and SSH keys.</li>
                    <li><strong>Merge Conflicts:</strong> Happens when changes in the same part of a file in two branches need to be merged. Resolve by manually editing the files and then committing the resolved version.</li>
                    <li><strong>'Branch not found' error:</strong> Ensure you have spelled the branch name correctly and that it exists on the remote.</li>
                    {/* Add more common errors and their solutions */}
                </ul>
            </section>

            {/* Additional Resources */}
            <section className="git-resources">
                <h2>Additional Resources</h2>
                {/* Links to external resources, tutorials, and documentation */}
            </section>

            {/* Conclusion */}
            <section className="git-conclusion">
                <h2>Conclusion</h2>
                <p>Mastering Git is a key skill for any developer. With practice, you can use Git effectively for your projects and collaboration.</p>
            </section>
        </div>
    );


}

export default Git;
